import React, { Component } from 'react';
import './App.css';
import TodoItem from './TodoItem';


class TodoList extends Component {
    render() {

        return (
            <div>
                <h1>TodoList</h1>
                <TodoItem></TodoItem>
            </div >
        );
    }
}

export default TodoList;
